Polski Instytut Wyceny jest jednostką naukową w rozumieniu ustawy o zasadach finansowania nauki utworzoną w formie fundacji non profit.
Organem nadzorczym Instytutu jest Minister Nauki i Szkolnictwa Wyższego.

Celami Instytutu są:
1. Prowadzenie i aplikacja badań w zakresie wyceny i analizy rynku, w szczególności na obszarze rynków nieruchomości, przedsiębiorstw, finansów, ubezpieczeń, rynków konsumenckich i opinii oraz wartości niematerialnych i prawnych;
2. Podejmowanie i wspieranie działań upowszechniających wiedzę o badaniach w zakresie wyceny i analizy rynku;
3. Podejmowanie i wspieranie działań umożliwiających implementację innowacyjnych rozwiązań w zakresie wyceny i analizy rynku;
4. Promowanie dobrych praktyk w zakresie wyceny i analizy rynku.

Instytut realizuje swoje cele przez:
1. Organizowanie, prowadzenie i wspieranie badań w zakresie związanym z celami Instytutu;
2. Prowadzenie działalności publicystycznej i informacyjnej w zakresie objętym celami Instytutu;
3. Udział w finansowaniu przedsięwzięć ukierunkowanych na realizację celów Instytutu;
4. Współpracę z krajowymi i zagranicznymi instytucjami naukowymi, oświatowymi, zawodowymi, społecznymi, gospodarczymi oraz organizacjami pozarządowymi, w tym także zagranicznymi i międzynarodowymi, których działalność wiąże się z celami Instytutu;
5. Współpracę w charakterze instytucji specjalistycznej z organami władzy publicznej i sądowniczej oraz administracji rządowej i samorządowej w zakresie objętym celami Instytutu. TRENDY 2024 TRENDY 2024. Detekcja, Pomiar, Aktualizacja Specjalistyczne warsztaty narzędziowe z zastosowania i obsługi arkusza TREND w praktyce rzeczoznawcy majątkowego organizowane przez Polski Instytut Wyceny , pod patronatem Polskiego Stowarzyszenia Rzeczoznawców Majątkowych : odbędą się dnia 16 listopada 2024 r. (w sobotę), w Warszawie tryb warsztatów: stacjonarny miejsce: Hotel Felix, Warszawa, ul. Omulewska 24 - Hotel Felix (fhotel.pl) prowadzący warsztaty: rzm Tomasz Kotrasiński Program warsztatów można pobrać z linku: TRENDY 24 Program Zgłoszenie można pobrać z linku: Formularz zgłoszeniowy Link do wydarzenia na Facebooku: TRENDY 2024 W warsztatach będzie prezentowana praktycznie, na realnych danych rynkowych problematyka: zjawiska zmian cen w czasie, trendów i cykli metod badania zmian cen w czasie, w tym trendów pomiaru siły trendów w wymiarze względnym i bezwzględnym określania charakterystyki trendów liniowych i nieliniowych badania istotności trendów oraz odstępstw trendów od liniowości aktualizacji cen na różne daty, w tym zagadnienia ekstrapolacji tworzenia i wykorzystania indeksów cenowych Analizy trendów będą wykonywane przy pomocy najnowszej wersji specjalistycznego arkusza TREND. Zapraszam wszystkie koleżanki i kolegów zainteresowane/nych zastosowaniem analizy trendów i aktualizacji cen w praktyce! Możliwe opcje uczestnictwa w warsztatach i/lub zakupu licencji arkusza TREND: Opcja 1 : samo uczestnictwo w warsztatach TRENDY: 975 zł + VAT Opcja 2 : sam zakup licencji arkusza TREND: 1.765 zł + VAT W przypadku jednoczesnego zakupu licencji arkusza TREND i uczestnictwa w warsztatach TRENDY cena warsztatów obniżona zostanie o 600 zł do 375 zł netto. Łączna cena warsztaty + arkusz wyniesie: 375 zł + 1.765 zł = 2.140 zł netto. Opcja 3 : uczestnictwo w warsztatach + zakup licencji